(1,	'cLink-button',	'link',	'a:15:{s:12:\"internalType\";s:8:\"document\";s:8:\"linktype\";s:8:\"internal\";s:4:\"text\";s:24:\"PREISSCHÄTZUNG ERHALTEN\";s:4:\"path\";s:9:\"/Estimate\";s:6:\"target\";s:0:\"\";s:10:\"parameters\";s:0:\"\";s:6:\"anchor\";s:0:\"\";s:5:\"title\";s:0:\"\";s:9:\"accesskey\";s:0:\"\";s:3:\"rel\";s:0:\"\";s:8:\"tabindex\";s:0:\"\";s:5:\"class\";s:0:\"\";s:10:\"attributes\";s:0:\"\";s:8:\"internal\";b:1;s:10:\"internalId\";i:15;}'),
