(1,	'content:1.content',	'wysiwyg',	'<p><strong>SimWeb</strong>&nbsp;ist eine Agentur für die entwicklung von Software. Es besteht aus einem jungen, kreativen, dynamischen und fachkundigen Team, das für seine Kunden in allen Tätigkeitsbereichen Projekte jeder Art und Größe durchführt. Wir gehen auf Ihre Bedürfnisse ein, indem wir Ihnen unser gesamtes Know-how im Bereich der Multiplattform-Web- und Mobilentwicklung zur Verfügung stellen.</p>\n\n<p>Wir bemühen uns, Ihre Probleme zu verstehen, und sind bestrebt, bessere Fragen zu stellen, um Ihr Unternehmen zu verbessern.</p>\n\n<ul>\n	<li><strong>Mobile-Entwicklung</strong></li>\n	<li><strong>Web-Entwicklung</strong></li>\n	<li><strong>Leistungsfähigkeit</strong></li>\n	<li><strong>Docker</strong></li>\n</ul>\n'),
