(26,	'5',	'team',	'Simo Claude',	16,	'claudesimo@gmail.com',	'Full-stack Entwickler',	'Gewinner lieben harte Arbeit. Sie lieben die damit verbundene Disziplin, den Kompromiss, den sie eingehen, um zu gewinnen. Verlierer hingegen sehen es als Bestrafung an. Und genau das ist der Unterschied.');
INSERT INTO `object_query_6` (`oo_id`, `oo_classId`, `oo_className`, `title`, `publishedAt`, `content`, `image`, `category__id`, `category__type`, `autoPublished`, `slug`) VALUES
(31,	'6',	'blog',	'Featured Post Title',	1630990800,	'Science is an enterprise that should be cherished as an activity of the free human mind. Because it transforms who we are, how we live, and it gives us an understanding of our place in the universe. The universe is large and old, and the ingredients for life as we know it are everywhere, so there\'s no reason to think that Earth would be unique in that regard. Whether of not the life became intelligent is a different question, and we\'ll see if we find that. If you get asteroids about a kilometer in size, those are large enough and carry enough energy into our system to disrupt transportation, communication, the food chains, and that can be a really bad day on Earth. I have odd cosmic thoughts every day For me, the most fascinating interface is Twitter. I have odd cosmic thoughts every day and I realized I could hold them to myself or share them with people who might be interested. Venus has a runaway greenhouse effect. I kind of want to know what happened there because we\'re twirling knobs here on Earth without knowing the consequences of it. Mars once had running water. It\'s bone dry today. Something bad happened there as well. ',	9,	33,	'object',	1,	'featured_post_title'),
(35,	'6',	'blog',	'Arbeit mit Docker',	1630998000,	'Docker updates subscription model to deliver scale, speed, and security The updated Docker subscription tiers deliver the productivity and collaboration developers rely on, paired with the security and trust businesses demand. Docker subscription tiers now include Personal, Pro, Team, and Buisness. ',	10,	34,	'object',	0,	'arbeit_mit_docker'),
(38,	'6',	'blog',	'Home Office',	1631006100,	'Sichern Sie Ihre telefonische Erreichbarkeit. Leiten Sie Ihre Anrufe zum Telefonservice von TELiAS um, wenn Sie im Home Office sind: Halten Sie zufriedene Kunden durch zuverlässige Erreichbarkeit Keine aufwändige Telefonanlagen-Programmierung o.ä. - einfache Anrufweiterschaltung Innerhalb weniger Minuten einsatzbereit Mitarbeiterliste anlegen, um alle Kollegen erreichbar zu machen Mitarbeitersekretariat für Mitarbeiter mit besonderer Zuständigkeit und Arbeitszeiten Dauerhaft oder bei Bedarf aktivierbar Das spricht für TELiAS 17 Jahre Erfahrung Nur festangestellte Mitarbeiter Garantiert keine Warteschleife Von Kunden empfohlen und mehrfach ausgezeichnet Wir sind persönlich, verantwortlich und fair ',	15,	33,	'object',	0,	'home_office'),
(39,	'6',	'blog',	'Pimcore Beste CMS',	1631010600,	'EFFIZIENTE LÖSUNGEN VOM PIMCORE GOLD PARTNER Mit&nbsp;Pimcore&nbsp;bringen Sie Ihr Datenmanagement auf ein neues Level: schnell, effizient und ohne zusätzliche Lizenzkosten. Die preisgekrönte Open Source-Unternehmensplattform verbindet Stammdatenmanagement (PIM / MDM), User Experience Management (CMS / UX), Digital Asset Management (DAM) und eCommerce. Als erfahrener Pimcore Gold-Partner der ersten Stunde begleitet Intera Sie bei der Einführung und Ausgestaltung der damit verbundenen Digitalisierungsprojekte. ',	18,	36,	'object',	0,	'pimcore_beste_cms');
